import React from "react";
import { useNavigate } from "react-router-dom";

const Task = ({ loggedIn }) => {
  const navigate = useNavigate();
  if (!loggedIn) {
    // If the user is not logged in, redirect to the login page
    return <navigate to="/login" />;
  }

  return <div>Task</div>;
};

export default Task;
